【商品名】
<br><br>
フォグランプカバー 2P
<br><br>

【適合車種】
<br><br>
ヴェゼル 標準バンパー装着車・フォグライト装着車 HYBRID対応<br>

※グレードやオプションにより形状が異なる場合がございます。お車の形状をご確認の上ご注文お願い致します。


<br><br>

【適合型式】
<br><br>
RU1/RU2/RU3/RU4
<br><br>

【適合年式】
<br><br>
H25.12～
<br><br>


【商品説明】
<br><br>
高級感ある鏡面仕上げ。<br>
ワンポイントアクセントでフロントフェイスをグッと引き締めます。<br>
裏面に強力両面テープ付。<br><br>

※取り付け部の油分・汚れ等をしっかり拭き取ってから装着お願い致します。<br>
※両面テープを剥がされた後での交換・返品等の対応は出来かねますので、必ず仮合わせの上装着お願い致します。
<br><br>
【送料】
<br><br>
全国一律864円 北海道1404円、沖縄・離島は別途必要となります。
<br><br>



その他詳しくは会社概要をお読みください。<br><br><br>


